const twoSum = (nums, target) => {
    let start = 0;
    let end = nums.length - 1;
    let sum = nums[start] + nums[end]
    if(nums.length < 2) {
        return -1;
    }
    while(start < end) {
        if(target > sum) {
            ++start;
        }
        if(target < sum){
            --end;
        }
        if(nums[start] + nums[end] === target) {
            return [start + 1, end + 1];
        }
        sum = nums[start] + nums[end]
    }
    return [0, 0]; // If no valid pair is found, return [0, 0]
}
